  expected_count: 5
  input: 'TEXT,F3XA,,"In response to your request for additional information, 21st
    century Democrats (The Committee) responds as follows: 1. Even though payments
    were made after the primary date, the value of the in-kind contributions was realized
    by the campaign on or before the date of the primary. The Committee has amended
    its report to add memo entries to show the dates that the campaign received the
    in-kind contribution(s). 2. Names in the News is a national list vending firm
    that facilitates the sale of The Committee''s list to other organizations. Having
    checked with Names in the News, we have been assured that the payments to the
    Committee is the ''ususal and normal'' charge for similar lists. 3. All of these
    expenditures are involved with The Committee''s own operations and none were made
    on behalf of any specifically identified candidate. 4. This expenditure was for
    printing invitations for the fundraising event ''Michigan 2004''. Please find
    this on the attached amendment. 5. The noted descriptions were all typographical
    errors and have been clarified on the attached amendment."'
